//[MiscUserCode] You can add your own definitions of your custom methods or any other code here...
void ExtraNotesAudioProcessorEditor::onParameterUpdated(const teragon::PluginParameter *parameter) {
    bool editTextActive = parameters["Edit Text"]->getValue() > 0.5;
    bool editImageActive = parameters["Edit Image"]->getValue() > 0.5;

    if(parameter->getName() == "Edit Text" ||
       parameter->getName() == "Edit Image") {
        textEditor->setVisible(editTextActive);
        imageViewer->setVisible(editImageActive);
    }
    else if(parameter->getName() == "Text") {
        textEditor->setText(parameter->getDisplayText(), false);
    }
    else if(parameter->getName() == "Load Item") {
        String filePatternsAllowed;
        if(editTextActive) {
            filePatternsAllowed = "*.txt";
        }
        else if(editImageActive) {
            filePatternsAllowed = "*.jpg;*.jpeg;*.gif;*.png";
        }

        FileChooser chooser("Open file...",
                            // TODO: Store this value somewhere
                            File::getSpecialLocation(File::SpecialLocationType::userHomeDirectory),
                            filePatternsAllowed);
        if(chooser.browseForFileToOpen()) {
            File selectedFile = chooser.getResult();
            if(editTextActive) {
                String fileContents = selectedFile.loadFileAsString();
                parameters.set("Text", fileContents.getCharPointer().getAddress(), this);
                parameters.processRealtimeEvents();
            }
            else if(editImageActive) {
                ImageFileFormat *imageFileFormat = ImageFileFormat::findImageFormatForFileExtension(selectedFile);
                InputStream *imageInputStream = selectedFile.createInputStream();
                Image image = imageFileFormat->decodeImage(*imageInputStream);
                imageViewer->setImage(image);
            }
        }
    }
}
